import React from "react";
import VideojuegoLista from "../Videojuego/VideojuegoLista";

const OfertaItem = ({idoferta}) => {
    return(
        <div className="col-lg-8 row-md-4">
            <VideojuegoLista idoferta={oferta} />
        </div>
    );
};

export default OfertaItem;
